Information
------------------------------

Lost Symbol: Truth or Fiction
Unravel the rumours, suspicions and scandals surrounding one of the largest secret societies in history, the Freemasons, to discover whether they deserve the reputation given to them by conspiracy theorists.
The subject of Dan Brown's blockbuster novel, The Lost Symbol, is here exposed. Delve into one of the largest and most talked about secret societies in history, the Freemasons. How did the society start? Now with an estimated five million members, what's behind its remarkable development and expansion? Some people regard the Freemasons as a quaint but innocent &quot;old boys&quot; network but what is the truth? Who are Freemasons in the present day and what do they do? After centuries of rumour, suspicion and scandal, The Lost Symbol: Truth or Fiction throws a spotlight on the Freemasons, discovering whether they deserve the reputation given to them by conspiracy theorists.

